in vec2 vUv;
out vec4 fragColor;

uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

#define MAX_STEPS 100
#define SURFACE_DIST 0.001
#define MAX_DIST 20.0

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Gyroid formula: sin(x)cos(y) + sin(y)cos(z) + sin(z)cos(x)
float gyroid(vec3 p, float scale, float thickness, float bias) {
    p *= scale;
    return abs(dot(sin(p), cos(p.zxy)) - bias) / scale - thickness;
}

// Scene SDF
float map(vec3 p) {
    // Morphing movement
    float t = iTime * 0.2;
    p.xy *= rot(t * 0.5);
    p.xz *= rot(t * 0.3);

    // Create several layers of gyroids at different scales
    float g1 = gyroid(p, 2.5, 0.03, 0.5 * sin(iTime * 0.4));
    float g2 = gyroid(p + 5.0, 5.0, 0.02, 0.3 * cos(iTime * 0.7));

    // Blend gyroids
    float d = mix(g1, g2, 0.5 + 0.5 * sin(iTime * 0.5));

    // Add a sphere constraint to keep blobs centered
    float sphere = length(p) - 2.8;

    // Intersection to keep it in a "blob" shape
    return max(d, sphere);
}

// Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    float d = map(p);
    vec3 n = d - vec3(
        map(p - e.xyy),
        map(p - e.yxy),
        map(p - e.yyx)
    );
    return normalize(n);
}

// Simple Palette
vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.263, 0.416, 0.557);
    return a + b * cos(6.28318 * (c * t + d + iTime * 0.1));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec3 col = vec3(0.0);

    // Camera setup
    vec3 ro = vec3(0.0, 0.0, -5.0);

    // Mouse interaction
    if(iMouse.z > 0.0) {
        float mX = (iMouse.x / iResolution.x - 0.5) * 6.28;
        float mY = (iMouse.y / iResolution.y - 0.5) * 3.14;
        ro.xz *= rot(mX);
        ro.yz *= rot(mY);
    }

    vec3 rd = normalize(vec3(uv, 1.2));

    // Re-orient ray based on camera position
    vec3 lookAt = vec3(0.0);
    vec3 f = normalize(lookAt - ro);
    vec3 r = normalize(cross(vec3(0.0, 1.0, 0.0), f));
    vec3 u = cross(f, r);
    rd = normalize(uv.x * r + uv.y * u + f * 1.5);

    float d = 0.0;
    float totalDist = 0.0;
    float glow = 0.0;

    // Raymarching
    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * totalDist;
        d = map(p);

        // Accumulate glow based on proximity to surface
        glow += 0.05 / (0.1 + abs(d));

        if(abs(d) < SURFACE_DIST || totalDist > MAX_DIST) break;
        totalDist += d * 0.6; // Smaller step for smoother glow
    }

    // Shading
    if(totalDist < MAX_DIST) {
        vec3 p = ro + rd * totalDist;
        vec3 n = getNormal(p);
        vec3 viewDir = normalize(ro - p);

        // Fresnel for organic feel
        float fresnel = pow(1.0 - max(dot(n, viewDir), 0.0), 4.0);

        // Base color based on position
        vec3 baseCol = palette(length(p) * 0.2 + iTime * 0.1);

        // Lighting
        float diff = max(dot(n, normalize(vec3(1, 2, -1))), 0.0);
        col = baseCol * diff;
        col += fresnel * baseCol * 2.0; // Glowy rim

        // Specular
        vec3 ref = reflect(rd, n);
        float spec = pow(max(dot(ref, normalize(vec3(1, 1, -1))), 0.0), 32.0);
        col += spec * 0.5;
    }

    // Apply volumetric/alpha glow
    vec3 glowCol = palette(iTime * 0.05) * 0.15;
    col += glow * glowCol;

    // Atmosphere / Distance fog
    col = mix(col, vec3(0.01, 0.02, 0.05), 1.0 - exp(-0.005 * totalDist * totalDist));

    // Post-processing
    col = pow(col, vec3(0.4545)); // Gamma correction
    col *= 1.2; // Contrast

    fragColor = vec4(col, 1.0);
}
